import { PipelineToolbar } from './toolbar';
import { PipelineUI } from './ui';
import { SubmitButton } from './submit';
import { TooltipProvider } from './components/ui/tooltip';
import { Workflow } from 'lucide-react';

function App() {
  return (
    <TooltipProvider>
      <div className="h-screen flex flex-col bg-background overflow-hidden">
        {/* Header */}
        <header className="flex-shrink-0 h-14 flex items-center justify-between px-4 bg-white border-b border-border shadow-sm">
          {/* Logo */}
          <div className="flex items-center gap-3">
            <div className="flex items-center justify-center w-8 h-8 rounded-lg gradient-primary">
              <Workflow className="w-5 h-5 text-white" />
            </div>
            <div>
              <h1 className="text-sm font-semibold text-foreground">Pipeline Builder</h1>
              <p className="text-[10px] text-muted-foreground">VectorShift Assessment</p>
            </div>
          </div>

          {/* Submit Button */}
          <SubmitButton />
        </header>

        {/* Toolbar */}
        <PipelineToolbar />

        {/* Main canvas area */}
        <main className="flex-1 overflow-hidden">
          <PipelineUI />
        </main>
      </div>
    </TooltipProvider>
  );
}

export default App;
